use std::collections::HashMap;

pub fn word_count(list: &[&str]) -> HashMap<&str, i32> {
    let mut word_dict: HashMap<&str, i32> = HashMap::new();
    for word in list {
       let count = word_dict.entry(word).or_insert(0);
       *count += 1;
    }
    word_dict
}
